    [Parameter]
    public string Admin_Username { get; set; }
    AdminTable new_user = new AdminTable();
    public int Admin_Id { get; set; }
    List<AdminTable> admins;
    protected override async Task OnInitializedAsync()
    {
        SchedulingSystemForELSOContext db = new SchedulingSystemForELSOContext();
        admins = db.AdminTable.ToList();
    }
    public void Show()
    {
        SchedulingSystemForELSOContext db = new SchedulingSystemForELSOContext();
        new_user = db.AdminTable.Where(a => a.Id == Admin_Id).FirstOrDefault();
    }
    protected async Task Delete()
    {
        SchedulingSystemForELSOContext db = new SchedulingSystemForELSOContext();
        var log_user = db.LoginTable.Where(l => l.Username == new_user.Username).FirstOrDefault();
        db.LoginTable.Remove(log_user);
        db.AdminTable.Remove(new_user);
        db.SaveChanges();
        toastService.ShowSuccess("Admin has been deleted successfully.");
        navigationManager.NavigateTo("/Setting_Page/" + Admin_Username);
    }
    protected async Task Cancel()
    {
        navigationManager.NavigateTo("/Setting_Page/" + Admin_Username);
    }

